import React from "react";
import InputField from "./InputField"; // Hvis du har laget et InputField-komponent
import { useForm } from "react-hook-form"; // Hvis du bruker react-hook-form for validering

function CVForm({ onSubmit }) {
  const { register, handleSubmit } = useForm();

  return (
    <div className="p-8 bg-gradient-to-r from-[#90E0EF] to-[#CAF0F8] min-h-screen">
      <h1 className="mb-20 flex items-center justify-center text-3xl font-bold text-[#023E8A]">
        Opprett CV
      </h1>

      <form
        onSubmit={handleSubmit(onSubmit)} // Bruk handleSubmit fra react-hook-form
        className="max-w-sm p-10 mb-8 bg-white rounded-lg shadow-lg"
      >
        <h2 className="text-center mb-4 text-xl text-[#023E8A]">Lag din CV</h2>

        {/* Personal Information Section */}
        <InputField
          type="text"
          placeholder="Fullt navn"
          {...register("personalInfo.name", { required: true })}
          required
        />

        <InputField
          type="email"
          placeholder="E-post"
          {...register("personalInfo.email", { required: true })}
          required
        />

        <InputField
          type="tel"
          placeholder="Telefonnummer"
          {...register("personalInfo.phone", { required: true })}
          required
        />

        {/* Skills Section */}
        <InputField
          type="text"
          placeholder="Ferdigheter (f.eks. JavaScript, React)"
          {...register("skills", { required: true })}
          required
        />

        {/* Education Section */}
        <h3 className="text-lg text-[#023E8A] mb-2">Utdanning</h3>
        <InputField
          type="text"
          placeholder="Institusjon"
          {...register("education[0].institution", { required: true })}
          required
        />
        <InputField
          type="text"
          placeholder="Grad"
          {...register("education[0].degree", { required: true })}
          required
        />
        <InputField
          type="text"
          placeholder="År"
          {...register("education[0].year", { required: true })}
          required
        />

        {/* Experience Section */}
        <h3 className="text-lg text-[#023E8A] mb-2">Erfaring</h3>
        <InputField
          type="text"
          placeholder="Stilling"
          {...register("experience[0].title", { required: true })}
          required
        />
        <InputField
          type="text"
          placeholder="Firma"
          {...register("experience[0].company", { required: true })}
          required
        />

        {/* References Section */}
        <h3 className="text-lg text-[#023E8A] mb-2">Referanser</h3>
        <InputField
          type="text"
          placeholder="Navn på referanse"
          {...register("references[0].name", { required: true })}
          required
        />
        <InputField
          type="text"
          placeholder="Kontaktinfo"
          {...register("references[0].contactInfo", { required: true })}
          required
        />

        {/* Submit Button */}
        <div className="flex justify-center w-full">
          <button
            type="submit"
            className="mt-16 p-3 text-white bg-[#0077B6] rounded-lg hover:bg-[#023E8A] focus:ring-4 focus:ring-[#90E0EF]"
          >
            Lag CV
          </button>
        </div>
      </form>
    </div>
  );
}

export default CVForm;
